import React, { useState, useEffect } from 'react';
import axios from 'axios'; // Assuming you're using Axios for API calls

const ListChargers = () => {
  const [chargers, setChargers] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios.get('http://localhost:8080/api/chargers/getallchargers');
      setChargers(response.data);
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>List of All Chargers </h1>
      <table>
        <thead style={{ color: 'white' }}> {/* Apply white color to table header */}
          <tr>
           
            <th>Longitude</th>
            <th>Latitude</th>
            <th>Rate(R</th>
          </tr>
        </thead>
        <tbody>
          {chargers.map((charger) => (
            <tr key={charger.id} style={{ color: 'white' }}> {/* Apply white color to each table row */}
              
              <td>{charger.longitude}</td>
              <td>{charger.latitude}</td>
              <td>{charger.rate}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ListChargers;
